import React from 'react'
import Card from './Card'
const Display = () => {
  return (
    <div>
       {list.map((lists) => (

        <Link
          key={lists.show.id}
          to={"/summary/" + lists.show.id}
        >
          <Card resData={lists} />
        </Link>

      ))}

    </div>
  )
}

export default Display
